import React from "react";

const GameRoom = ({ meetingUrl }) => {
  return (
    <div className="game-room">
      <h1>Game Room</h1>
      {meetingUrl ? (
        <iframe
          src={meetingUrl}
          width="800"
          height="600"
          allow="camera; microphone"
        />
      ) : (
        <p>Loading meeting...</p>
      )}
    </div>
  );
};

export default GameRoom;
